suite("Generic",function(){this.timeout(2e3);var e=document.getElementById("container");teardown(function(){e.innerHTML=""}),test("generic style on by default",function(t){var n=document.createElement("generic-element");e.appendChild(n),flush(function(){assert(n.generic);var e=getComputedStyle(n).display;assert.equal(e,"block"),t()})}),test("generic style off",function(t){var n=document.createElement("generic-element");n.generic=!1,e.appendChild(n),flush(function(){var e=getComputedStyle(n).display;assert.equal(e,"inline-block"),t()})}),test("set generic to false via attribute",function(t){var n=document.createElement("div");Polymer.dom(n).innerHTML='<generic-element generic="false"></generic-element>',e.appendChild(n),flush(function(){var e=Polymer.dom(n).children[0],i=getComputedStyle(e).display;assert.equal(i,"inline-block"),t()})})});